                            description:
                              "This expression generates an automatic walk cycle for a character.\n\nYou simply move the main controller layer of your character and the expression moves the feet, hands and body accordingly to make the character walk or run. Instead of moving the character, you can also move the ground layer that the character is walking on (or both).\r\n\r\nSkeleton Setup\r\nYou first need to setup a skeleton for your character - either with iExpressions or any other rigging tools like DuIK, Rubber Hose or Limber. \r\nActually, the walk cycle expression does not care about the details of the rig, it just assumes that\r\na) you have one controller (goal layer) for each foot, arm and the body, which allow to move these individual parts and\r\nb) one master controller that these individual controllers from a) are parented to, such that they all move when the master is moved.\r\n\r\nThe you simply keyframe the movement of the master controller b) and apply the iExpression to all the individual controllers from a) such that it moves them as needed.\r\n\r\nCustom Walk Cycles\r\nThe expression has built-in generic animations for walking and running, but you can also use it with your own custom walk cycles. \r\nIf you want to use a custom walk cycle, in a separate composition you keyframes your reference walk cycle manually and then connect the layers of this reference walk cycle in the expression parameters at \'Custom Walk cycle -> Linked Properties\'\r\n\r",
