                        description:
                          'This iExpressions lets a 2D or layer move like a roller coaster. To use it, proceed in the following steps.\n1) Draw the roller coaster track as a mask path\n2) Copy the mask path and paste it to the position property of the layer. Now the layer moves with a constant speed along the roller coaster track. Instead of using a mask path, you can also keyframe this motion by hand (e.g. when the desired path is 3D). You only need to make sure to make the keyframes "rove accross time" such that the layer moves with constant speed before the iExpression is applied. \n3) Apply the iExpression to the position of the layer and adjust gravity, start position, and start speed to get the desider movement\n4) Adjust max speed and friction to fine-tune the movement. You can also link those properties to sliders to animate them over time. This allows, for example to manually slow down the roller coaster at specific points in time.\n\nNow you have a single Layer that moves like a rollercoaster. If you want to animate several layers such that they behave like different wagons of the same roller coaster, you better do not apply the "Roller Coaster Master" to each of them, but better proceed as follows.\n\nI) Animate a dummy layer (e.g. a NULL layer or solid) as described in steps 1-4\nII) Duplicate the dummy layer and set the "Output" property of the iExpression to "Master Data" in the first and to "Track Data" in the second copy.\nIV) Apply the "Roller Coaster Wagon" iExpression to position and rotation of each layer that should become a rollercoaster wagon. Link the parameters "Link To Master Data" and "Link To Track Data" to the positions of the respective layer from step II. Use the "Position Offset" parameter to position the different wagons.\nV) If a wagon is rotated upside down, set its (keyframe value of) rotation from 0 to 180.',
