                    description:
                      "Design animations in Ae for React Spring!\r\nsee https://www.react-spring.io\r\n\r\nThis expression interpolates between keyframes in the same way as react-spring (version 8) and has exactly the same parameters. So if the animations you create should be implemented in React Spring, simply use this expression instead of normal keyframes and when implementing the animation in React Spring, simply copy and paste the parameters from the expression.\r\n\r\nCREATING ANIMATIONS\r\n\r\nReact Spring creates time-less animations, i.e. you don\'t specify the duration of movements or motion path curves. Instead you just specify a target position and how strongly the object is attracted by this target position. When you apply this expression, your keyframes turn into target positions. So if you have two keyframes, for example, immediately after the first keyframe, the value is attracted by the second keyframes and moves towards it based on the spring physics parameters you set in the expression. Only the value of the keyframes is considered, the easing you set in Ae is ignored and replaced by the spring simulation. You can have as many keyframes as you want, to move the target position over time and can apply the expression to arbitrary 1D, 2D and 3D properties.\r\n\r\nAPPLE AND ANDROID\r\niExpressions contains similar expressions for the spring systems of Android and Apple\'s UIKit (or SwiftUI). If you need to create animations that need to be implemented on any of those platforms, too, better use the Android or UIKit Spring expression. Those expressions can calculate and output the required spring parameters for all platforms (react-spring, Android and SwiftUI), hence it is easy to implement the animation on all those platforms. The react-spring expression does not have such a feature, since the clipping option of react-spring has no comparable parameter in the other spring systems. Hence, if you need the clipping option and only develop for react, use the react spring expression, in other cases better use the Android or UIKit spring expression for maximum flexibility.",
